import React, { useEffect } from "react";
import { GlobalContext } from '../global.context';
import Card from '../Components/Card';

const Favs = () => {
  const { state } = React.useContext();
  const { favs } = state;

  useEffect(() => {
    // Realiza cualquier l칩gica adicional si es necesario al cargar la p치gina de favoritos
  }, []);

  return (
    <div className={`theme-${state.theme}`}>
      <h1>Dentistas Favoritos</h1>
      <div className="card-grid">
        {favs.length > 0 ? (
          favs.map((dentist) => (
            <Card key={dentist.id} dentist={dentist} />
          ))
        ) : (
          <p>No tienes dentistas destacados.</p>
        )}
      </div>
    </div>
  );
};

export default Favs;
